{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/kashof97/cyclistic-bike-share-analysis?scriptVersionId=127573993\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"f242b8be","metadata":{"execution":{"iopub.execute_input":"2023-04-22T14:04:02.893175Z","iopub.status.busy":"2023-04-22T14:04:02.886158Z","iopub.status.idle":"2023-04-22T14:04:02.925159Z"},"papermill":{"duration":0.024464,"end_time":"2023-04-28T13:22:19.712881","exception":false,"start_time":"2023-04-28T13:22:19.688417","status":"completed"},"tags":[]},"source":["## Prephase\n","\n","**Case Study: How Does a Bike-Share Navigate Speedy Success?**\n","\n","**Introduction**\n","\n","Welcome to the Cyclistic bike-share analysis case study! In this case study, you will perform many real-world tasks of a junior data analyst. You will work for a fictional company, Cyclistic, and meet different characters and team members. In order to answer the key business questions, you will follow the steps of the data analysis process: ask, prepare, process, analyze, share, and act. Along the way, the Case Study Roadmap tables — including guiding questions and key tasks — will help you stay on the right path.\n","\n","**Scenario**\n","\n","You are a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, your team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, your team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve your recommendations, so they must be backed up with compelling data insights and professional data visualizations. Characters and teams\n","\n","Cyclistic: A bike-share program that features more than 5,800 bicycles and 600 docking stations. Cyclistic sets itself apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can’t use a standard two-wheeled bike. The majority of riders opt for traditional bikes; about 8% of riders use the assistive options. Cyclistic users are more likely to ride for leisure, but about 30% use them to commute to work each day.\n","\n","Lily Moreno: The director of marketing and your manager. Moreno is responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n","\n","Cyclistic marketing analytics team: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy. You joined this team six months ago and have been busy learning about Cyclistic’s mission and business goals — as well as how you, as a junior data analyst, can help Cyclistic achieve them.\n","\n","Cyclistic executive team: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program.\n","\n","**About the company**\n","\n","In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime. Until now, Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments. One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.\n","\n","Cyclistic’s finance analysts have concluded that annual members are much more profitable than casual riders. Although the pricing flexibility helps Cyclistic attract more customers, Moreno believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all-new customers, Moreno believes there is a very good chance to convert casual riders into members. She notes that casual riders are already aware of the Cyclistic program and have chosen Cyclistic for their mobility needs.\n","\n","Moreno has set a clear goal: Design marketing strategies aimed at converting casual riders into annual members. In order to do that, however, the marketing analyst team needs to better understand how annual members and casual riders differ, why casual riders would buy a membership, and how digital media could affect their marketing tactics. Moreno and her team are interested in analyzing the Cyclistic historical bike trip data to identify trends.\n","\n","This project will be completed using the 6 phases of Data Analysis namely:\n","\n","- **Ask**: In this stage the key business questions will be identified along with the stakeholders\n","- **Prepare**: Collect the data, identify how it’s organized, determine the credibility of the data.\n","- **Process**: Select the tool for data cleaning, check for errors and document the cleaning process.\n","- **Analyze**: Organize and format the data, aggregate the data so that it’s useful, perform calculations and identify trends and relationships.\n","- **Share**: Use design thinking principles and data-driven storytelling approach, present the findings with effective visualization. Ensure the analysis has answered the business task.\n","- **Act**: Share the final conclusion and the recommendations."]},{"cell_type":"markdown","id":"9887535e","metadata":{"execution":{"iopub.execute_input":"2023-04-22T13:55:33.677911Z","iopub.status.busy":"2023-04-22T13:55:33.674255Z","iopub.status.idle":"2023-04-22T13:55:33.702698Z"},"papermill":{"duration":0.020278,"end_time":"2023-04-28T13:22:19.754048","exception":false,"start_time":"2023-04-28T13:22:19.73377","status":"completed"},"tags":[]},"source":["# Phase 1: ASK\n","\n","Question to guide the future marketing program.\n","\n","## How do *annual members* and *casual riders* use Cyclistic bikes **differently**?\n","\n","Guiding Questions\n","\n","- What is the problem you are trying to solve?\n","- How can your insights drive business decisions?\n","\n","\n"]},{"cell_type":"markdown","id":"b2206972","metadata":{"papermill":{"duration":0.019614,"end_time":"2023-04-28T13:22:19.793331","exception":false,"start_time":"2023-04-28T13:22:19.773717","status":"completed"},"tags":[]},"source":["# Phase 2: PREPARE\n","\n","2.1 Where is the data located?\n","\n","[https://divvy-tripdata.s3.amazonaws.com/index.html](https://divvy-tripdata.s3.amazonaws.com/index.html)\n","\n","2.2 How is the data organized?\n","\n","For the purposes of this case study, the datasets are appropriate and will enable me to answer the business questions. The data has been made available by Motivate International Inc. under this [license](https://ride.divvybikes.com/data-license-agreement).\n","\n","2.3 Are there issues with bias or credibility in this data? Does your data ROCCC?\n","\n","- **Reliable**: Since it's a fictional company, the reliability of the dataset is not subject to question.\n","- **Original**: Since it's a fictional company, the originality of the dataset is not subject to question.\n","- **Comprehensive**: It seems to have sufficiant data range to produce good quality insights.\n","- **Current**: Since it's a fictional company, the time window of the dataset is not subject to question.\n","- **Cited**: It's an open-source dataset for educational purposes.\n","\n","2.4 How are you addressing licensing, privacy, security, and accessibility?\n","\n","The dataset has been properly licensed and is made public for anybody to access. This is public data that you can use to explore how different customer types are using Cyclistic bikes. But note that data-privacy issues prohibit you from using riders’ personally identifiable information. This\n","means that you won’t be able to connect pass purchases to credit card numbers to determine if casual riders live in the\n","Cyclistic service area or if they have purchased multiple single passes.\n","\n","\n","\n"]},{"cell_type":"markdown","id":"2c542084","metadata":{"papermill":{"duration":0.019313,"end_time":"2023-04-28T13:22:19.831943","exception":false,"start_time":"2023-04-28T13:22:19.81263","status":"completed"},"tags":[]},"source":["# Phase 3: PROCESS"]},{"cell_type":"code","execution_count":1,"id":"0abcc579","metadata":{"execution":{"iopub.execute_input":"2023-04-28T13:22:19.876687Z","iopub.status.busy":"2023-04-28T13:22:19.87458Z","iopub.status.idle":"2023-04-28T13:22:21.093356Z","shell.execute_reply":"2023-04-28T13:22:21.091427Z"},"papermill":{"duration":1.244491,"end_time":"2023-04-28T13:22:21.09588","exception":false,"start_time":"2023-04-28T13:22:19.851389","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.0     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.1     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.1.8\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \n","── \u001b[1mConflicts\u001b[22m ───────────────────────────