timization search engines and popular visitor's sites of interest to increase the reach and offer special packages on the membership schemes. Increasing the number of bikes' availability over the period of these 3 months. \n","2. Design campaign to promote the usage of bikes regularly by highliting the health and environmental benefits by creating a mobile application which can show the calories burnt and carbon emmission reduction. \n","3. And have a reward system once a certain level is reached. This will encourage memberships.\n","4. Collaborate with organizations and companies in promoting the usage of bikes by offering various membership schemes; this will be a win-win situation for both.\n","5. Increase the number of classic bikes availability from December to March as the total number of casual rides with classic bikes were high during these months. Design campaigns to promote the classic bike's usage by highliting it's benefits during these coldest months of Chicago.\n","\n","Further analysis needs to be carried out to find insights to reduce the average ride duration of casual riders as currently although ~43% of the total rides are done by casual riders but the average ride duration is ~3 times more than the member riders. And to increase the availability of bikes; need to shorten the ride duration."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":186.876952,"end_time":"2023-04-28T13:25:22.796282","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-04-28T13:22:15.91933","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}